B.U5=new A.aO("Gendang Beleq is a traditional musical instrument that is played in groups. Gendang Beleq comes from the Sasak Tribe, Lombok, West Nusa Tenggara, Indonesia. The origin of the word drum comes from the sound of the drum itself, namely the sound of deng or dung. Beleq comes from the Sasak language which means big.[2] Gendang Beleq means big drum., HISTORY In the past, in Lombok, the Beleq drum was used as an encouragement for soldiers who went to war and who returned from war. Thus, the Beleq drum was used as music in war. Now Gendang Beleq is used as musical accompaniment in traditional ceremonies such as Merariq (wedding), circumcision (circumcision), Ngurisang (baby haircut or aqiqah) and begawe beleq (big ceremony). How to Play The Beleq drums are played in groups to form an orchestra. The Gendang Beleq Orchestra consists of two Gendang Beleq called mama (male) and gendang nina (female) which function as carriers of dynamics. It also consists of a Codeq drum (small drum), a belek perembak and Kodeq perembak as rhythmic instruments, a gong and two reogs, namely reog nina and reog mama as melodic carriers. Gendang Beleq players play Gendang Beleq while dancing. Gendang beleq players consist of 13 to 17 people. Score The Beleq drum has philosophical values \u200b\u200band is also sacred by the Sasak people. The Sasak people consider Gendang Beleq to have the value of beauty, perseverance, patience, wisdom, thoroughness, and heroism. These values \u200b\u200bare always expected to blend with the hearts of the Sasak people",null,null,null,B.ah,null,null,null,null,null,null,null,null,null)
